        [HttpGet("CreatePDF")]
        public string CreatePDF()
        {
            var name = "Aamir";
            string oldFilePath = "C:\\Users\\dev05\\Desktop\\test.html";
            string newFilePath = "C:\\Users\\dev05\\Desktop\\backup.html";
            //var currentDir = Environment.CurrentDirectory;
            //string oldFilePath = Path.Combine(currentDir, @"NewFolder\test.html");

            //string newFilePath = Path.Combine(currentDir, @"NewFolder\backup.html");
            // Create a backup of the original file
            System.IO.File.Copy(oldFilePath, newFilePath, true);
            var htmlContentNew = System.IO.File.ReadAllText(newFilePath);
            var htmlContentOld = System.IO.File.ReadAllText(oldFilePath);
            htmlContentNew = htmlContentNew.Replace("{{name}}", name);
            using (StreamWriter writer = new StreamWriter(newFilePath))
            {
                writer.Write(htmlContentNew);
            }
            var globalSettings = new GlobalSettings
            {
                ColorMode = ColorMode.Color,
                Orientation = Orientation.Portrait,
                PaperSize = PaperKind.A4,
                Margins = new MarginSettings { Top = 10 },
                DocumentTitle = "PDF Report"
            };

            var objectSettings = new ObjectSettings
            {
                PagesCount = true,
                Page = newFilePath,
                WebSettings = { DefaultEncoding = "utf-8", UserStyleSheet = Path.Combine(Directory.GetCurrentDirectory(), "assets", "styles.css") },
                HeaderSettings = { FontName = "Arial", FontSize = 9, Right = "Page [page] of [toPage]", Line = true },
                FooterSettings = { FontName = "Arial", FontSize = 9, Line = true, Center = "Report Footer" }
            };

            var pdf = new HtmlToPdfDocument()
            {
                GlobalSettings = globalSettings,
                Objects = { objectSettings }
            };
            var file = _converter.Convert(pdf);
            byte[] pdfBytes = file.ToArray();
            var documentNew = Convert.ToBase64String(pdfBytes);
            return documentNew;
        }

